import logo from './logo.svg';
import './App.css';
import Todo from "./todo"
import Home from "./Home" 
import { BrowserRouter as Router, Switch, Route ,Link} from "react-router-dom";



function App() {
  return (
    <div>

          <Route exact path="/" component={Home}/>
          <Route path="/todo" component={Todo}/>





    </div>

  );
}

export default App;
